The Last Detective Serie 1 D2 Moonlight 	


Dangerous Davies onderzoekt de verdwijning van Vernon, wiens vrouw zich absoluut geen zorgen maakt. Hun onderbuurvrouw en haar broer verslappen echter bij het zien van Davies. Zijn nieuwsgierigheid groeit als Vernon's auto met de sleutels in het contact bij het vliegveld opduikt.


English

Storyline

&quot;Dangerous Davies is a decent man in an indecent world, a man out of his time, and hopefully a perfect antidote for the more gritty, violent detective series.&quot;



